import React, {useState} from "react"
import Login from "./other/Login.jsx"
import Register from "./other/Register.jsx"

function App() {
  const [currForm, setCurrForm]=useState("Login");
  const toggle = (temp)=>{
    setCurrForm(temp);
  }
  return (
    <div>
      {
     currForm==="login"?<Login onFormSwitch={toggle}/>:<Register/>
      }
    </div>
  );
}

export default App;
